class Noku{init(){this.http=cordova.plugin.http;this.http.setDataSerializer("json");this.http.setRequestTimeout(5);this.memes=[null];this.users=[]}testToken(callback){const options={method:"post",data:{token:this.token,uid:this.uid},headers:{}};this.http.sendRequest(this.getAPIUrl()+"tokencheck",options,function(response){callback(response,true)},function(response){callback(response,false)})}login(username,password,callback){const options={method:"post",data:{username:username,password:password},headers:{}};this.http.sendRequest(this.getAPIUrl()+"login",options,function(response){callback(response,true)},function(response){callback(response,false)})}register(username,password,email,callback){const options={method:"post",data:{email:email,username:username,password:password},headers:{}};this.http.sendRequest(this.getAPIUrl()+"register",options,function(response){callback(response,true)},function(response){callback(response,false)})}setCredentials(token,uid){this.token=token;this.uid=uid}getMemes(callback){const options={method:"post",data:{uid:this.uid,token:this.token},headers:{}};this.http.sendRequest(this.getAPIUrl()+"getmemes",options,function(response){callback(response,true)},function(response){callback(response,false)})}getCDNUrl(){return"https://cdn.xemplarsoft.com/"}getAPIUrl(){return"https://xemplarsoft.com/noku/api/"}getUserData(id,callback){const options={method:"post",data:{uid:this.uid,token:this.token,user_id:id},headers:{}};this.http.sendRequest(this.getAPIUrl()+"getuserdata",options,function(response){callback(response,true)},function(response){callback(response,false)})}getAllLikes(id,callback){const options={method:"post",data:{uid:this.uid,token:this.token,user_id:id},headers:{}};this.http.sendRequest(this.getAPIUrl()+"getalllikes",options,function(response){callback(response,true)},function(response){callback(response,false)})}getAllMemes(id,callback){const options={method:"post",data:{uid:this.uid,token:this.token,user_id:id},headers:{}};this.http.sendRequest(this.getAPIUrl()+"getallmemes",options,function(response){callback(response,true)},function(response){callback(response,false)})}getAllSubscribers(id,callback){const options={method:"post",data:{uid:this.uid,token:this.token,user_id:id},headers:{}};this.http.sendRequest(this.getAPIUrl()+"getallsubs",options,function(response){callback(response,true)},function(response){callback(response,false)})}getMimeType(hash,callback){const options={method:"post",data:{uid:this.uid,token:this.token,hash:hash},headers:{}};this.http.sendRequest(this.getAPIUrl()+"getmimetype",options,function(response){callback(response,true)},function(response){callback(response,false)})}getMemeData(id,callback){const options={method:"post",data:{uid:this.uid,token:this.token,id:id},headers:{}};this.http.sendRequest(this.getAPIUrl()+"getmemedata",options,function(response){callback(response,true)},function(response){callback(response,false)})}getCommentsByID(id,callback){const options={method:"post",data:{uid:this.uid,token:this.token,meme_id:id},headers:{}};this.http.sendRequest(this.getAPIUrl()+"getcomments",options,function(response){callback(response,true)},function(response){callback(response,false)})}requestSignIn(){}}